// src/pages/Dashboard.jsx
import React from 'react';
import Sidebar from '../components/Sidebar';        // Import Sidebar component
import WelcomeCards from '../components/WelcomeCards';  // Import WelcomeCards component

const Dashboard = () => {
  return (
    <div className="d-flex">
      <Sidebar />  {/* Sidebar with user info and navigation */}
      <div className="p-4 w-100">
        <h4 className="fw-bold">Welcome Sakshi!</h4>  {/* User-specific greeting */}
        <p className="text-muted">Stay Organized, Stay Ahead</p>  {/* Motivational text */}
        <WelcomeCards />  {/* Render the WelcomeCards component */}
      </div>
    </div>
  );
};

export default Dashboard;
